import styled from "styled-components/native"

export const FirstView3 = styled.View`
flex-direction: row;
align-items: center;
display: flex;
`;

export const BigText3 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 24px;
line-height: 28px;
text-align: center;
color: #C3AD60;
`;

export const SecondView3 = styled.View`
margin-top: 55px;
align-items: center;
justify-content: center;
`;

export const PhotoView = styled.ImageBackground`
width: 280px;
height: 200px;
border-radius: 100px;
position: relative;

`;

export const Quantity = styled.View`
position: absolute;
top: 16px;
left: 217px;
background-color: rgba(78,78,78,0.5);
flex-direction: row;
display: flex;
align-items: center;
flex: 1;
padding: 8px;
border-radius: 100px;
`;

export const QtyText = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 14px;
line-height: 16px;
letter-spacing: -0.333333px;
color: #FFFFFF;
`;

export const ButtonText = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 18px;
line-height: 21px;
letter-spacing: -0.333333px;
color: #000000;
`
